import React from "react";

const Cart = () => {
  const cartItems = [
    {
      itemName: "Cornbread",
      itemPrice: 3,
      imgSrc: ""
    },
    {
      itemName: "Grilled corn",
      itemPrice: 4,
      imgSrc: ""
    }
  ];

  const renderedCartItems = cartItems.map((cartItem) => {
    return (
      <div className="cart-item">
        <div className="cart-img-box">
          <img src={cartItem.imgSrc} alt=""/>
        </div>
        <div className="cart-item-about">
          <h1 className="cart-item-title">{cartItem.itemName}</h1>

        </div>
      </div>
    );
  });

  return (
    <div className="cart-page-body">
      <div className="cart-container">
        <div className="cart-header">
          <h3 className="cart-heading">Shopping Cart</h3>
          <h5 className="cart-action">Remove All</h5>
        </div>
        <div className="cart-item">
          <div className="cart-img-box">
            <img src=""/>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Cart;
